import React from 'react';
import { Button, View, Text } from 'react-native';
import { StatusBar } from 'expo-status-bar';
import { NavigationContainer } from '@react-navigation/native';
import { createNativeStackNavigator } from '@react-navigation/native-stack';
import Login from './src/app/screens/login';
import Home from './src/app/screens/home';
import Preco from './src/app/screens/preco';
import EditPreco from './src/app/screens/preco/edit';

const Stack = createNativeStackNavigator();

function App() {
  return (
    <NavigationContainer>
      <Stack.Navigator  screenOptions={{
        headerStyle: {
          backgroundColor: '#677689',
        },
        headerTintColor: '#fff',
        headerTitleStyle: {
          fontWeight: 'bold',
        },
      }}
     initialRouteName="Login">     
       <Stack.Screen name="Login" component={Login} options={{ title: 'Login' }}/>
       <Stack.Screen name="Home" component={Home} options={{ title: 'Home' }}/>
       <Stack.Screen name="Preco" component={Preco} options={{ title: 'Produtos' }}/>
       <Stack.Screen name="EditPreco" component={EditPreco} options={{ title: 'Editar Produto' }}/>
      </Stack.Navigator>
    </NavigationContainer>
  );
}

export default App;
